import './style.css';
import perfil from '../../Images/perfil.svg';
import sacola from '../../Images/sacola.svg';

const icones = [perfil, sacola]

const iconesHeader = () => {
    return (
        <ul className='icones'>
            {icones.map(icone => <li className='icone'><img src={icone} /></li>)}
        </ul>
    );
};

export default iconesHeader;
